const Tweet = ({ tweetContent }) => {
  return (
    <blockquote className="twitter-tweet blockquote">
      <span className="author">John Smith </span>
      <span className="time"> 6 hours ago </span>
      <p lang="en" dir="ltr">
        <span> {tweetContent}</span>
        {/* <a href="#"></a>
      <video poster="url" controls>
        <source src="url" type="url" />
      </video>
      <a href="url">
        <img className="img-thumbnail" src="" />
      </a> */}
      </p>
      <footer>
        <h6>
          <i className="fa fa-comment-o"></i>20 &nbsp;
          <i className="fa fa-retweet"></i>25 &nbsp;
          <i className="fa fa-heart-o"></i>55 &nbsp;
        </h6>
      </footer>
    </blockquote>
  );
};

export default Tweet;
